class CipherTextOnlyAttackCBC():
    """
    Implementation of Cipher-text Only Attack in CBC mode
    """

    def __init__(self, ciphertext_path, IV_text_path):
        """
        :param ciphertext_path: the text we would like to find the key it was encrypted with
        :param IV_text_path: the initialization vector (IV) used to encryption

        This function processes the text: Load the files according to the paths above.
        Each block size will be as equal as the IV size. Before dividing to blocks,
        required padding will be added (if necessary).
        """

        # filter and avoid any '[' or ']' characters
        ciphertext_path = re.sub('[\[\]]', '', ciphertext_path)
        IV_text_path = re.sub('[\[\]]', '', IV_text_path)

        self.text_path = ciphertext_path  # for retrieving file name

        # Load relevant files and avoid any '[' or ']' characters
        with open(IV_text_path) as file:
            self.IV_text = file.readline()

        with open(ciphertext_path,'rb') as file:
            self.text = file.read().decode("utf-8")

        self.keys = self.keygen() # a list of keys, will be filled later with random keys.
        self.padding() # add padding to the ciphertext if necessary
        self.blocks = self.divide_to_blocks() # divide ciphertext to blocks

    def keygen(self):
        """
        this function creates a list called "keys" which contains the following paris: [key,0]
        It will look like this: [ [key_1, counter_1]  ,  [key_2, counter_2] , ... , [key_n, counter_n] ]
        Each key is a possible permutation of the 8-bit key (a-h to a-h)
        The returned list will include all possible permutations, for the brute-force apply.
        """
        keys = []
        initial = [chr(ord('a')+i) for i in range(8)] # a list of a-h characters
        permutations = itertools.permutations(initial,8)
        for per in permutations:
            # build a relevant dictionary:
            current_key = []
            current_key.append({per[i]: initial[i] for i in range(8)}) # the key
            current_key.append(0) # counter with 0
            keys.append(current_key)
        return keys

    def key_format(self, key):
        """
        This function converts the key to the relevant format for writing to a text file.
        :param key: The key we want to convert to the relevant text format
        :return: a string formatted according to the relevant text format.
        """
        reversed_key = ''
        a_h = [chr(ord('a')+i) for i in range(8)] # a list of a-h characters
        for letter in a_h:
            reversed_key += str("%s %s\n" % (letter,key[letter]))
        return reversed_key[:-1]

    def find_key(self):
        """
        Finding the best key by BRUTE-FORCE.
        The process will be as followed:
        1. for each key:
        1.1. decrypt the text
        1.2. split text to words
        1.3. for each word in text:
        1.3.1. if the word is in words_set:
        1.3.1.1. counter for current key + 1
        2. find the key with maximum counter
        3. REVERSE the key
        4. apply key format
        5. write key to file
        """
        for i in range(len(self.keys)): # [ [key_0, counter_0] [key_1, counter_1] ... [key_n, counter_n]  ]
            if time.time() - start > 55: # have we exceeded the time interval?
                break
            else: # we still have time
                decrypted_text = ''
                previous_block = self.IV_text

                # decrypt text according to current key, maximum 150 blocks, so we'll be able to try all possible keys.
                for current_block in self.blocks[:150]:
                    deciphered_block = ''
                    for j in range(len(previous_block)):
                        # Step 1: apply decryption.
                        # for each character in block, check if it's existing in current key in self.keys
                        if current_block[j] in self.keys[i][0]:
                            char = self.keys[i][0][current_block[j]]
                        else:
                            char = current_block[j]
                        # Step 2: XOR between the blocks
                        xor = chr(ord(previous_block[j]) ^ ord(char))
                        # Step 3: add the XORed result to the deciphered block.
                        deciphered_block += xor

                    previous_block = current_block
                    # Step 3: add current ciphered block to decrypted text
                    decrypted_text += deciphered_block

                # Now try to see how many logical words are present in the decrypted text.
                # It will be done by filtering the decrypted text from any characters that differ from a-z,A-Z," "
                for word in re.sub(r'[^a-zA-Z ]+', ' ', decrypted_text.lower()).split():
                    if word in words_set:
                        self.keys[i][1] += 1

        # Now find the best key (the one with the maximum counter value)
        self.keys.sort(key=lambda x: x[1])
        
        # Reverse the key and convert it to the wanted format
        reversed = {value: k for k,value in self.keys[-1][0].items()} # reverse the key
        best_key = self.key_format(reversed)                     # retrieve the wanted string format

        # Write the best key to file
        text_name = self.text_path[0:self.text_path.find('.txt')]  # retrieve file name
        with open(text_name + '_key.txt', 'wb') as output:
            output.write(best_key.encode("utf-8"))

    def padding(self):
        """
        This function adds padding to the text, if needed.
        """
        block_remainder = len(self.text) % len(self.IV_text)
        if block_remainder > 0: # if block remainder is not equal to zero, it means we need to add padding.
            missing_chars = len(self.IV_text) - block_remainder
            self.text += ('\0' * missing_chars)

    def divide_to_blocks(self):
        """
        Divide the loaded text to blocks in the same size as IV.
        """
        block, blocks = '', []
        for i in range(len(self.text)):
            block += self.text[i]
            if len(block) == len(self.IV_text):
                blocks.append(block)
                block = ''

        return blocks

